import React, { useEffect, useState, useRef } from "react";
import Chart from "chart.js/auto";

// NavigationBar component
const NavigationBar = () => {
  return (
    <nav className="bg-white p-4 text-black">
      {/* Navigation items */}
      <ul className="flex justify-between">
        <li>
          <nav />
        </li>
      </ul>
    </nav>
  );
};

// Dashboard component
// Dashboard component
const Dashboard = ({
  fullStockLevel = 1,
  outOfStockItems = 0,
  fullTotalValue = 1,
}) => {
  // Console log statements need to be inside the component function but outside the JSX return statement
  console.log("fullStockLevel:", fullStockLevel);
  console.log("outOfStockItems:", outOfStockItems);
  console.log("fullTotalValue:", fullTotalValue);

  return (
    <div>
      {/* Include the NavigationBar component */}
      <NavigationBar />
      {/* Dashboard content */}
      <div>
        <p>Full Stock Level: {fullStockLevel}</p>
        <p>Out of Stock Items: {outOfStockItems}</p>
        <p>Full Total Value: {fullTotalValue}</p>
      </div>
      {/* Other Dashboard components */}
    </div>
  );
};

export default Dashboard;
